import React, { Component } from 'react';
import Interviews from './Interviews';
import NewInterview from './NewInterview';
import NewJobs from './NewJobs';
import TestSkills from './TestSkills';
import AboutUs from './AboutUs';
import { Route, NavLink, Switch } from 'react-router-dom';
import LeftMenu from './LeftMenu'
import RightMenu from './RightMenu'
import { Drawer, Button } from 'antd';

class Header extends Component {
      state = {
        current: 'interviews',
        visible: false
      }
      showDrawer = () => {
        this.setState({
          visible: true,
        });
      };
    onClose = () => {
        this.setState({
          visible: false,
        });
      };
    render() {
        return (
          <div>
          <nav class="navbar navbar-inverse">
            <div class="container-fluid">
              <div class="navbar-header">
                <a class="navbar-brand" href="#">Logo</a>
              </div>
              <ul class="nav navbar-nav">
                <li class="active"><a href="#">Interviews</a></li>
                <li><a href="#">Add Interview</a></li>
                <li><a href="#">New Job Openings</a></li>
                <li className="dropdown header" style = {{ color: "grey" }}>Test Skills
                  <li>
                    <a href="" style = {{ color: "grey" }}>Aptitude</a>
                  </li>
                  <li>
                    <a href="" style = {{ color: "grey" }}>Technical</a>
                  </li>
              </li>
              </ul>
            </div>
          </nav>

            <Switch>
                    <Route path = "/test-skills" exact component = { TestSkills } />
                    <Route path = "/interviews/" exact  component = { Interviews } />
                    <Route path = "/interview-corner/"  exact component = { AboutUs } />
                    <Route path = "/interviews/new" exact component = { NewInterview } />
                    <Route path = "/new-jobs" exact component = { NewJobs } />
                    {/*<Route path = "/:id" exact  component = { FullPost } />*/}
            </Switch>
            </div>
        );
      }
    }

export default Header;


